import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import avatar from '../assests/profile.webp';
import styles from '../styles/Password.module.css';

export default function Password() {
  const [password, setPassword] = useState('');
  const [error, setError] = useState('');
  const navigate = useNavigate();

  const handleSubmit = (e) => {
    e.preventDefault();
    if (!password) {
      setError('Password is required');
    } else {
      setError('');
      // Handle password validation logic here

      // On success, navigate to the desired page
      navigate('/home'); // Example: Navigate to the dashboard or home page
    }
  };

  return (
    <div className="container mx-auto">
      <div className='flex justify-center items-center h-screen'>
        <div className={styles.glass}>
          <div className="title flex flex-col items-center">
            <h4 className='text-5xl font-bold'>Enter Password</h4>
            <span className='py-4 text-xl w-2/3 text-center text-gray-500'>
              Enter your password to continue
            </span>
          </div>
          <form className='py-1' onSubmit={handleSubmit}>
            <div className='profile flex justify-center py-4'>
              <img src={avatar} className={styles.profile_img} alt="avatar" />
            </div>

            <div className="textbox flex flex-col items-center gap-6">
              <input
                className={styles.textbox}
                type="password"
                placeholder='Password'
                value={password}
                onChange={(e) => setPassword(e.target.value)}
              />
              {error && <p className="text-red-500">{error}</p>}
              <button className={styles.btn} type='submit'>Sign In</button>
            </div>

            <div className="text-center py-4">
              <span className='text-gray-500'>Forgot Password? <Link className='text-red-500' to="/reset-password">Reset</Link></span>
            </div>
          </form>
        </div>
      </div>
    </div>
  );
}
